import { baseUrl } from "../constants";

const getAll = async () => {
    const response = await fetch(`${baseUrl}/entries`);
    const data = await response.json();

    if (!response.ok) {
        throw new Error(data);
    }

    return data;
}

const saveEntry = async (entryId, )

export const entriesService = { getAll };
